import './App.css';
import Header from './MyComponents/Header';
import Home from './MyComponents/Home';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";

export default function App() {
  return (
    <Router>
    <div className="app">
      <Routes>
        <Route path="/">
          <Root/>
        </Route>
        <Route path="/checkout">

        </Route>
      </Routes>
    </div>
    </Router>
  );
}

function Root() {
  return (
    <div>
      <Header/>
      <Home/>
    </div>
  );
}

function Checkout() {
  return (
    <div>
      <Header/>
      <p>React Router Demo</p>
    </div>
  );
}
